import React from 'react';

//Bring back from lambda that just finds all distinct categories and brings back in order of question?
//Could also bring back questions for each cat?
export default class SummaryCategory extends React.Component {
    render() {
        return (
            <>
                <h2 className="heading-medium">{this.props.catProps.category}</h2>

                <div className="text-block">
                    {this.props.catProps.questions.map((question) => {
                        return (
                            <p key={question.id}>
                                <strong>{question.displayName}</strong>
                                <br />
                                {question.value}
                            </p>
                        );
                    })}
                </div>

            </>
        )
    }
}
